    "Visitor estimation evaluation and strategies : Developing accurate visitation
    estimation at two urban National Wildlife Refuges in the Mountain-Prairie Region",nt"tracking_summary":
    {ntt"total": 5,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-08-30T12:25:07.461823",nt"name": "visitor-estimation-evaluation-and-strategies-developing-accurate-visitation-estimation-at-",nt"isopen":
    false,nt"url": null,nt"notes": "Visitor numbers are a key metric for a
    variety of conservation planning and management purposes. However, challenges remain
    in improving accuracy of visitor estimation at refuge field stations. This project
    provides focused resources to two Region 6 priority urban refuges to demonstrate
    that the information and methods of the Visitation Estimation Workbook and Technical
    Supplements are feasible, and that minor changes in methods can lead to significant
    improvement in visitor estimation accuracy. The objective of this project is to
    provide Rocky Mountain Arsenal National Wildlife Refuge and Bear River Migratory
    Bird Refuge with evaluations, recommendations, and data-collection tools to improve
    visitor estimation accuracy.",nt"license_title": "License Not Specified",nt"extras":
